import React from 'react';
import ReactDOM from 'react-dom';
import './style.css';
import TodoItems from './TodoItems.js'
import ContactCard from './ContactCard';


function App() {
    return(
        <div className="todo">
            <TodoItems />
            <TodoItems />
            <TodoItems />
            <TodoItems />
        </div>
    );
}

function App1() {
    return(
        <div>
            <ContactCard />
            <ContactCard />
            <ContactCard />
            <ContactCard />
        </div>
    );
}


ReactDOM.render(<App1 />, document.getElementById('root'));
